    width: 500%;
    border-bottom: 1px solid #d1d8e4;
    height: auto;
    
`

const Element = styled.div`
    margin: 0 auto;
    width: 100%;
    height: auto;
    display: flex;
    flex-flow: row wrap;
    
`

